export const complete = (id) => {
    return {
        type: 'COMPLETE',
        id: id
    }   
}

export const addTask = (obj) => {
    return {
        type: 'ADD_TASK',
        obj: obj
    }   
}

export const deleteTask = (id) => {
    return {
        type: 'DELETE_TASK',
        id: id
    }   
}

export const priorTask = (id,prior) => {
    return {
        type: 'PRIOR_TASK',
        id: id,
        prior: prior
    }   
}
